import React, {useState, useEffect} from 'react';
import {Document, Page, pdfjs } from 'react-pdf';

pdfjs.GlobalWorkerOptions.workerSrc = new URL(
  "react-pdf/node/build/pdf.worker.min.mjs",
  import.meta.url
).toString();

function LectionPage() {

  const [links, SetLinks] = useState();
  const i = 1;

  useEffect(()=>{
    fetch('http://localhost:3001/data')
        .then(response => response.json())
        .then((data) => {
          SetLinks(data[0].lecture[i].link)
          console.log(data[0].lecture[i].link);
          
        })
  },[]);

  return (
    <div className="lection__contents">
      <div className="menu"></div>
      <Document file={'/test.pdf'} className={'lection__document'}>
        <Page pageNumber={1}></Page>
      </Document>
    </div>
  );
}
export default LectionPage;
